import React from 'react'
import '../index.css'
import BuchenPopup from './buchenPopupContent'



const BuchenLogic = ({ showModal, closeModal}) => {

        function modelCheck(closeModal) {
            if(closeModal == true){
                return null 
            }else if (closeModal == false) {
                return showModal ? <div className='test2'>{<BuchenPopup />}</div> : null
            }
        }
        return <div>{modelCheck(closeModal)}</div>
           
}

export default BuchenLogic
